ControlPropertyState.AutoRuleBindingString:
UpdateContext({locPP_Contrato:false});
UpdateContext({locPP_Aditivos:false});
UpdateContext({locPP_PlanilhaOrcamentaria:false});
Reset(inpStatus_Busca_8);
Reset(inpProduto_Busca_4);
Reset(inpProduto_Busca_3);
Reset(inpProduto_Busca_5);
Reset(inpProduto_Busca_6);
Reset(inpProduto_Busca_7);

UpdateContext(
    {
        varHistoricoExpandidoDetalhado: If(
            varHistoricoExpandidoDetalhado = ThisItem.numero_medicao,
            Blank(),
            ThisItem.numero_medicao
        )
    }
);

ClearCollect(colMedicacaoDetalhado, Filter(collRegistrosUnicosFinal, numero_medicao = ThisItem.numero_medicao));

If(
    Self.Icon = Icon.ChevronDown,
    Set(
        varQuantidadeItensDetalhado,
        0
    ),
    Set(
        varQuantidadeItensDetalhado,
        CountRows(colMedicacaoDetalhado)
    )
);

//Collection com mais de 2 mil itens

UpdateContext({VarInicial:true});

// 7️⃣. Limpa as collections que não estão sendo utilizadas
Clear(RegistroMes);
Clear(collRegistrosFiltrados);

// 0️⃣. Define o número de registros do lote
UpdateContext({VarLote: 100});

// 1️⃣. Captura o primeiro e o último registro baseado no ID
UpdateContext({firstRecord: First(db_fin_medicao).ID});
UpdateContext({lastRecord: First(Sort(db_fin_medicao, ID, SortOrder.Descending)).ID});

// 2️⃣. Calcula o número de lotes necessários (arredondando para cima)
UpdateContext({RegistroMesNo: RoundUp((lastRecord - firstRecord) / VarLote, 0)});

// 3️⃣. Cria uma sequência de iteradores para segmentação
ClearCollect(RegistroMes, Sequence(RegistroMesNo, 1));

// 4️⃣. Define a coleção final onde serão armazenados os registros filtrados
ClearCollect(collRegistrosFiltrados, []);

// 5️⃣. Itera sobre os lotes e coleta os registros paginados
ForAll(
    RegistroMes,
    With(
        {
            prevThreshold: ThisRecord.Value * VarLote,
            nextThreshold: (ThisRecord.Value + 1) * VarLote
        },
        Collect(
            collRegistrosFiltrados,
            Filter(
                db_fin_medicao,
                contrato = TextInput1_19.Selected.n_contrato &&
                medicao_ativo = "Ativo"
            )
        )
    )
);

ClearCollect(
    collRegistrosUnicosFinal,
    ForAll(
        GroupBy(collRegistrosFiltrados, ID, TempGroup),
        First(TempGroup)
    )
);

ClearCollect(
    colMedicaoEmpreendimento_Detalhado,
    AddColumns(
        GroupBy(
            collRegistrosUnicosFinal,
            numero_medicao,
            ItensPorMedicao
        ),
        Soma_valor_executado,
        Sum(ItensPorMedicao, valor_executado_periodo),
        Soma_valor_acumulado,
        Sum(ItensPorMedicao, valor_executado_acumulado),
        id_contrato_empreendimento,
        LookUp(ItensPorMedicao, !IsBlank(empreendimento), empreendimento), 
        periodo_medicao,
        LookUp(ItensPorMedicao, !IsBlank(periodo_medicao), periodo_medicao), 
        competencia_medicao,
        LookUp(ItensPorMedicao, !IsBlank(competencia_medicao), competencia_medicao), 
        Item_Grupo,
        First(ItensPorMedicao).item_grupo
    )
);

UpdateContext({VarInicial:false});
